webpackJsonp([0xd7dfc83a82b9],{334:function(e,t){e.exports={data:{site:{siteMetadata:{author:"---",defaultTitle:"Capstone",defaultDescription:"---"}},markdownRemark:{html:'<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 740px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Summer"\n        title=""\n        src="/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-ee728.png"\n        srcset="/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-d6301.png 185w,\n/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-8e204.png 370w,\n/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-ee728.png 740w,\n/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-7116c.png 1110w,\n/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-b13ed.png 1480w,\n/capstone/static/summersky-fe1890423209b89c8b26cbe1d0d9b73e-0b084.png 1920w"\n        sizes="(max-width: 740px) 100vw, 740px"\n      />\n    </span>\n  </span>\n  </p>\n<p>Waiting out the summer, trying to figure out what I was going to do after receiving my RTW status was very lax. I knew what was coming as early as signing my probation contract for my second term because I was already mentally clocked out of caring for school and didn\'t bother to do anything to make it better. I simply wasn\'t in the right place with what my purpose for being in Nutrition and Food was. I still somewhat did the bare minimum to pass coursesl; That flame was still lit, albeit dim. It was for the purpose of setting myself up for making a comeback for the semester. Perhaps I\'d find myself at least a half or a third of the way there, that that flame would really ignite and I\'d somehow pull myself through the semester in the end. This didn\'t happen. By the end, I was even more so determined to go into graphic design, and it was a huge sigh of relief that I didn\'t have to deal with the anxiousness of school anymore.</p>\n<p>But what was I going to do with my time going forward? I didn\'t even take up a job or volunteer work like I told myself I would. I wasn\'t very proactive at all. It was a very lax period as I said, and in retrospect, I don\'t even regret the time wasted; Because I was proactive in one thing, and that was looking at my Plan B that was so clearly paved out to me by now, to start pursuing graphic design. </p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 740px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 31.538461538461537%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Design"\n        title=""\n        src="/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-ee728.png"\n        srcset="/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-d6301.png 185w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-8e204.png 370w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-ee728.png 740w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-7116c.png 1110w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-b13ed.png 1480w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-8e6ad.png 2220w,\n/capstone/static/design-f13f74aa40fba09188ca7ab80cf3a922-5861d.png 4160w"\n        sizes="(max-width: 740px) 100vw, 740px"\n      />\n    </span>\n  </span>\n  </p>\n<p>What I\'ve always been particularly interested in is web development and UI, maybe a little bit of iconography, but not branding or anything. Making layouts for projects of any sort in school and as a hobby has always been incredibly enjoyable to me, and so I thought to apply this enjoyment to making a potential career out of it. I started working towards it, and began curating a portfolio over the summer to shoot for graphic design. </p>\n<p>It did nothing but make me frustrated.</p>\n<p>I quickly remembered why this wasn\'t my Plan A career path to begin with. I took on the task of learning more CSS and JavaScript. The problems that appear in code that one has to then solve gave me no gratification at all. Maybe for some it does, maybe for some it doesn\'t and they still love it, but the latter was far from me. It just reminded me how much I hated working with code, how could I have forgotten?</p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 740px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 39.25974884335757%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Code"\n        title=""\n        src="/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-ee728.png"\n        srcset="/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-d6301.png 185w,\n/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-8e204.png 370w,\n/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-ee728.png 740w,\n/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-7116c.png 1110w,\n/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-b13ed.png 1480w,\n/capstone/static/code-84ef270ff26b0e7595c981d02482ee09-5ef7f.png 1513w"\n        sizes="(max-width: 740px) 100vw, 740px"\n      />\n    </span>\n  </span>\n  </p>\n<p>And to add it to the scope of thinking about having a career with this? No thank you. I hated the thought of having to do this very work for <em>someone else</em>. To think up a design for someone else, to have it undergo revisions for their sake, to solve frustrating coding problems for them? No.</p>\n<p>And this could all be looked at differently quite frankly, that doing the work for someone else would also be for myself too: The experience gained in order to better my work, become more efficient at code, expand my scope of design, etcetera, etcetera. This all didn\'t sound too convincing either, because in the back of my mind, I was able to answer, "Yes, I\'d better myself this way" to all those arguments had I applied them to the scope of Nutrition and Food. That\'s the sort of field I\'d prefer to do for someone else.</p>\n<p>If someone were to ask me to help them with designing something, I still find enjoyment in suggesting design ideas and sharing what I know of the elements and principals of design, but this sort of zest goes even further when faced with the topic of Nutrition and Food. I feel an even greater enjoyment in being able to help people reframe their current understanding of nutrition and even teach of the real concerns surrounding it. With all the misinformation about nutrition that circulates social media today, it excites me to be a part of an ever changing science that could very well proove certain misinformation to one day be true.</p>\n<p>So in my lax summer of doing what seems like mostly wasted time, I figured out my plans going forward. I figured out that I\'m going to get my feet back on the ground and go through the motions of studying Nutrition and Food, a program that has already fostered invaluable knowledge related to health sciences that I would have never known had I not been given the opportunity to learn from professors in a university setting.</p>',excerpt:"Waiting out the summer, trying to figure out what I was going to do after receiving my RTW status was very lax. I knew what was coming as…",timeToRead:3,fields:{date:"October 29, 2018",slug:"/journal/refocus-repurpose-realignment/"},frontmatter:{title:"Refocus, Repurpose, Realignment"}}},pathContext:{slug:"/journal/refocus-repurpose-realignment/"}}}});
